import React from 'react';
import '../../index.css'


const Login = () => {
  return (
     <div className={"auth-bg"}
          style={{
            backgroundImage: `url(${require('../../assets/Elivate9ja/auth-bg.jpeg')})`,
            backgroundPosition: 'center',
            backgroundSize: 'cover',
            backgroundRepeat: 'no-repeat',
          }}
     >
       <div className={'d-flex justify-content-center align-items-center flex-column fullheight'}>
          <div>
            <img alt={'elivate logo'} src={require('../../assets/Elivate9ja/Elivate9ja-01.svg')} width={'114.1px'} height={'80px'}/>
          </div>
       </div>
    </div>
  );
};

export default Login;
